INSERT INTO `damage_report` (`id_damage_report`, `id_vessel`, `Date`, `Description`, `PIC`, `Status`, `DamageTime`, `CausedDamage`, `DamagePhoto`, `Suggestion`, `Master`, `ChiefEngineer`) VALUES
(6, 11, '2012-04-19', 'Kerusakan pada Penegar dan pelat side board.', 'Fajar', 'OPEN', '2012-04-19', 'BG AURA berbenturan dengan MV Bandar Manis.', 'media/upload/damage_report/DSC_0905_0423850.JPG', 'dilakukan penggantian penegar besar dan penegar kecil dan redeform pelat sideboard.', 'Hari Lahabu', 'Deden Eddy Hermawan'),
(8, 8, '2012-04-17', 'Kerusakanan pada daun baling-baling. daun baling-baling mengalami deformasi pada ujung-ujungnya. daun yang deformasi mengalami retak memanjang ketika dilakukan proses pemanasan pada permukaan daun baling-baling.', 'Fajar Riyadi', 'CLOSED', '2012-04-17', 'Daun mengalami deformasi akibat terbentur kayu. Daun baling-baling mengalami retak memanjang karena faktor material.', 'media/upload/damage_report/IMG_1611.JPG', 'Dilakukan heat treatment untuk mengembalikan daun baling-baling ke bentuk semula. dilakukan pengelasan untuk daun yang retak dan patah.', 'Ismail Malawat', 'Fredirikus Nusa'),
(9, 11, '2012-05-15', 'Sideboard sebelah kiri mengalami kerusakan, H Beam bengkok dan Plat masuk ke dalam.', 'Fajar', 'OPEN', '2012-04-19', 'AURA menabrak MT Bandar Manis di pelabuhan Gresik', 'media/upload/damage_report/aura_vs_bandar_amis.jpg', 'Akan dilaksanakan repair di banjarmasin , Plat , H beam, Angle diganti .', 'Capt Harry Lahabu', 'Deden Eddy Hermawan'),
(10, 10, '2012-05-15', 'dterdapat lubang dan retakan las pada deck cargo area', 'Dhika', 'OPEN', '2012-05-08', 'Diindikasikan terkena bucket pada saat bongkar', 'media/upload/damage_report/1.jpg', 'Untuk lubang akan di insert plate baru untuk menutup lubang, Untuk retakan akan di las ulang . Las yang lama akan di hilangkan terlebih dahulu', 'Capt Ridwan', 'Yuwono'),
(11, 78, '2012-08-27', 'Towing Guard Stbd patah. terkena benturan saat Tambat', 'Dhika', 'CLOSED', '2012-08-17', 'terkena benturan saat Tambat di banjarata, karena dorongan arus.', 'media/upload/damage_report/BA_p9_170812.jpg', 'Repair, di las ulang dan diganti elbow pipe yang baru. karena yang lama penyok', 'Capt Angga', 'Abdul Rasyid');
